import React from 'react';
import './BusinessPartners.css';

function BusinessPartners() {
    return (
        <div className='partners__container'>
            <div className='partners__header'>
                <h2 className='partners__title'> Business Partners </h2>
            </div>

            <div className='partners__card'>
                <ul className='partners__item'>
                    <li className='partners__item__details'>
                        <img className='partner__logo' src='../images/insurance-logos/AIA-logo.png'></img> 
                        <h3> AIA Insurance </h3>           
                    </li>

                    <li className='partners__item__details'>
                        <img className='partner__logo' src='../images/insurance-logos/AIA-logo.png'></img> 
                        <h3> Zurich Insurance </h3>           
                    </li>

                    <li className='partners__item__details'>
                        <img className='partner__logo' src='../images/insurance-logos/AIA-logo.png'></img> 
                        <h3> Manulife Insurance </h3>           
                    </li>



                </ul>'
            </div>
        </div>
    )
}

